ction_id` = `obj`.`collection_id`) limit 1) AS `project_id`,(select `cp`.`name` from `moderna_projects` `cp` where (`cp`.`id` = `project_id`) limit 1) AS `project_name`,(select `cp`.`pasta` from `moderna_projects` `cp` where (`cp`.`id` = `project_id`) limit 1) AS `project_pasta` from `moderna_objects` `obj`) */;

